import React from 'react';
import RepairCard from './RepairCard';

const RepairList = ({ repairs, onUpdate, onDelete, onDownload }) => {
  return (
    <div>
      {repairs.length === 0 ? (
        <p className="text-body">No repair requests found.</p>
      ) : (
        repairs.map((repair) => (
          <RepairCard
            key={repair._id}
            repair={repair}
            onUpdate={onUpdate}
            onDelete={onDelete}
            onDownload={onDownload}
          />
        ))
      )}
    </div>
  );
};

export default RepairList;
